/* 
drop table Verkauf;
drop table Ort ;
drop table Kunde;
drop table Produkt ;
drop table zeit;
 */



create table Ort (
     O_ID int primary key,
     O_Filiale  varchar(30) not null,
     O_Stadt varchar(30),
     O_Bundesland varchar(30),
     O_Land varchar(30)
);

create table Kunde (
     K_ID int primary key,
     K_Name varchar(30),
     K_Wohnort varchar(30),
     K_Strasse varchar(30),
     K_Geschlecht char(1),
     K_Kundengruppe varchar(30)
);

create table Produkt (
     P_ID int primary key,
     P_Bezeichnung varchar(40) not null,
     P_Verkaufspreis numeric(6, 2) not null,
     P_Rabatt numeric(5, 2),
     P_Einkaufspreis numeric (6, 2) not null,
     P_Steuern numeric (5, 2),
     P_Produktgruppe varchar(30), -- bier, softdrink, wein, ....
     P_Produktkategorie varchar(30) -- getränke, tabak, zeitschriften
);

create table zeit (
     Z_ID int primary key,
     Z_Datum date not null
);

create table Verkauf (
     V_Anzahl integer not null,
     V_Kanal char(1) not null, -- l für laden, k für katalog, w für web, ....
     V_Produkt_ID int references Produkt(P_ID),
     V_Zeit_ID int references zeit(Z_ID),
     V_Kunden_ID int references Kunde(K_ID),
     V_Ort_ID int references Ort(O_ID),
     primary key (V_Produkt_ID, V_Zeit_ID, V_Kunden_ID, V_Ort_ID)
);



